      description: `Op aanbeveling van Garner haalt Coulson Skye uit actieve dienst en laat haar achter op een schuilplaats met handschoenen die ontworpen zijn om haar te helpen haar krachten te onderdrukken. Ward en Agent 33 sporen de man op die het masker van Agent 33 heeft gemaakt. Hij repareert haar masker zodat ze haar oorspronkelijke gezicht weer aan kan nemen en haar uiterlijk naar believen kan veranderen. Hiermee infiltreren ze Talbots basis en halen Bakshi uit de gevangenis. Van Bakshi leren ze over Agent 33's leven voordat hij haar hersenspoelde. Mack stelt Hunter voor aan Robert Gonzales en de leiders van "het echte S.H.I.E.L.D."`,
